Primality proof for n = 165001:
<p>Take b = 3.
<p>b^(n-1) mod n = 1.
<p><a href=11.html>11 is prime.</a>
<br>b^((n-1)/11)-1 mod n = 17912, which is a unit, inverse 135072.
<p><a href=5.html>5 is prime.</a>
<br>b^((n-1)/5)-1 mod n = 21522, which is a unit, inverse 55008.
<p>(5^4 * 11) divides n-1.
<p>(5^4 * 11)^2 > n.
<p>n is prime by Pocklington's theorem.
